import React, { useEffect, useRef, useState, useCallback } from 'react';
import { View, Animated, StyleSheet, Dimensions } from 'react-native';

const SEGMENT_LENGTH = 37.5;
const BASE_SNAKE_LENGTH = 52;
const BASE_SPEED = 6;
const SNAKE_LENGTH = 35;
const SPEED = 4;
const MAX_TURNS = 3;
const MIN_SPAWN_DELAY = 2000;  // Minimum time between spawns (ms)
const MAX_SPAWN_DELAY = 5000;  // Maximum time between spawns (ms)
const MAX_ACTIVE_SNAKES = 8;   // Maximum number of snakes on screen
const MIN_ACTIVE_SNAKES = 3;   // Minimum number of snakes on screen

// New constants for randomization
const LENGTH_VARIATION = 20; // Random variation in length
const SPEED_VARIATION = 3; // Random variation in speed

const AnimatedLines = () => {
  const screenWidth = Dimensions.get('window').width;
  const screenHeight = Dimensions.get('window').height;
  const [snakes, setSnakes] = useState([]);
  const animationFrameRef = useRef();
  const initialSnakesSet = useRef(false);

  const createSnake = () => ({
    id: Math.random(),
    dots: Array(BASE_SNAKE_LENGTH + Math.floor(Math.random() * LENGTH_VARIATION)).fill(0).map(() => ({
      x: new Animated.Value(-SEGMENT_LENGTH),
      y: new Animated.Value(0),
    })),
    direction: { x: 1, y: 0 },
    position: { x: -SEGMENT_LENGTH, y: Math.random() * screenHeight * 0.8 + screenHeight * 0.1 },
    path: [],
    turnsRemaining: MAX_TURNS,
    lastTurnX: -SEGMENT_LENGTH,
    speed: BASE_SPEED + (Math.random() * SPEED_VARIATION), // Random speed for each snake
  });

  // Create initial snakes only once
  useEffect(() => {
    if (!initialSnakesSet.current) {
      setSnakes([createSnake(), createSnake(), createSnake()]);
      initialSnakesSet.current = true;
    }
  }, []);

  // Separate effect for spawning new snakes
  useEffect(() => {
    const spawnSnake = () => {
      setSnakes(current => {
        const activeSnakes = current.filter(
          snake => snake.position.x <= screenWidth + SEGMENT_LENGTH
        );

        if (activeSnakes.length < MIN_ACTIVE_SNAKES) {
          return [...activeSnakes, createSnake()];
        } else if (activeSnakes.length < MAX_ACTIVE_SNAKES) {
          return [...activeSnakes, createSnake()];
        }
        return activeSnakes;
      });

      const delay = MIN_SPAWN_DELAY + Math.random() * (MAX_SPAWN_DELAY - MIN_SPAWN_DELAY);
      setTimeout(spawnSnake, delay);
    };

    const initialDelay = MIN_SPAWN_DELAY + Math.random() * (MAX_SPAWN_DELAY - MIN_SPAWN_DELAY);
    const timeoutId = setTimeout(spawnSnake, initialDelay);

    return () => clearTimeout(timeoutId);
  }, []);

  const moveSnakes = useCallback(() => {
    setSnakes(current => 
      current.map(snake => {
        // Update head position using snake's individual speed
        snake.position.x += snake.direction.x * snake.speed;
        snake.position.y += snake.direction.y * snake.speed;

        // Store path point
        snake.path.push({ ...snake.position });
        if (snake.path.length > SNAKE_LENGTH) {
          snake.path.shift();
        }

        // Change direction with limitations
        const distanceSinceLastTurn = Math.abs(snake.position.x - snake.lastTurnX);
        if (snake.turnsRemaining > 0 && 
            distanceSinceLastTurn > SEGMENT_LENGTH * 8 &&
            Math.random() < 0.003) {
          const directions = [
            { x: 1, y: 0 },
            { x: 0, y: 1 },
            { x: 0, y: -1 },
          ];
          const availableDirections = directions.filter(d => 
            d.x !== snake.direction.x || d.y !== snake.direction.y
          );
          snake.direction = availableDirections[Math.floor(Math.random() * availableDirections.length)];
          snake.turnsRemaining--;
          snake.lastTurnX = snake.position.x;
        }

        // Update dot positions
        snake.dots.forEach((dot, index) => {
          const pathPoint = snake.path[Math.max(0, snake.path.length - 1 - index)] || snake.position;
          dot.x.setValue(pathPoint.x);
          dot.y.setValue(pathPoint.y);
        });

        return snake;
      })
    );
  }, []);

  // Animation effect
  useEffect(() => {
    let isActive = true;

    const animate = () => {
      if (!isActive) return;
      moveSnakes();
      animationFrameRef.current = requestAnimationFrame(animate);
    };

    animate();

    return () => {
      isActive = false;
      if (animationFrameRef.current) {
        cancelAnimationFrame(animationFrameRef.current);
      }
    };
  }, [moveSnakes]);

  return (
    <View style={styles.container}>
      {snakes.map((snake) => (
        <View key={snake.id}>
          {snake.dots.map((dot, index) => (
            <Animated.View
              key={index}
              style={[
                styles.dot,
                {
                  opacity: (SNAKE_LENGTH - index) / SNAKE_LENGTH * 0.3,
                  transform: [
                    { translateX: dot.x },
                    { translateY: dot.y }
                  ]
                },
              ]}
            />
          ))}
        </View>
      ))}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    pointerEvents: 'none',
  },
  dot: {
    position: 'absolute',
    width: 4,
    height: 4,
    backgroundColor: '#F4E409',
    borderRadius: 2,
  },
});

export default AnimatedLines;
